import React from 'react';
import { Leader, LeaderInfo } from './Leader';
import leninPhoto from './assets/img/Lenin.jpg';

function App() {
    const lenin: LeaderInfo = {
        name: 'ленин',
        image: leninPhoto,
        info: ['asdasd'],
        years: '1111'
    }
    return <div>
        <Leader {...lenin} />
    </div>
}

export default App;
